function level.initializeTiles()

	drawTilesWidth = love.graphics.getWidth() / tileSize
	drawTilesWidth = drawTilesWidth + 2
	drawTilesHeight = love.graphics.getHeight() / tileSize
	drawTilesHeight = drawTilesHeight + 2

	tileSetImage = love.graphics.newImage("tiles.png")
	tileSetImage:setMipmapFilter("nearest", 3) -- this "linear filter" removes some artifacts if we were to scale the tiles

	-- dirt
	tiles[0] = love.graphics.newQuad(0 * tileSize, 0 * tileSize, tileSize, tileSize,
	tileSetImage:getWidth(), tileSetImage:getHeight())

	-- oil
	tiles[1] = love.graphics.newQuad(1 * tileSize, 0 * tileSize, tileSize, tileSize,
	tileSetImage:getWidth(), tileSetImage:getHeight())

	tilesetBatch = love.graphics.newSpriteBatch(tileSetImage, drawTilesWidth * drawTilesHeight)

end

function level.updateTilesetBatch()
  tilesetBatch:clear()

  for x=0, drawTilesWidth do
    for y=0, drawTilesHeight do
      tilesetBatch:add(tiles[map[x + mapX][y + mapY]], x*tileSize, y*tileSize, 0, 1, 1, 0, 0, 0, 0)
    end
  end
end

function level.load()
	level.initializeTiles()
	level.updateTilesetBatch()
end

function level.draw()
	love.graphics.draw(tilesetBatch)
end


